import React from 'react';
import logo from './logo.svg';
import './App.css';
import './components/HeaderComponent'

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <p>This is my react first application</p>
      </header>
    </div>
  );
}

export default App;
